### System information

- **OS version/distro**: Windows 10 17134.345
- **.NET Version (eg., dotnet --info)**: 2.1.402

### Issue

- **What did you do?** I tried to load a ONNX model that generated by Python onnxmltools and want to load the onnx model file, then apply to my test data.
- **What happened?** I got exceptions **System.AccessViolationException: 'Attempted to read or write protected memory. This is often an indication that other memory is corrupt.'**
- **What did you expect?** The model could be loaded and scored.

### Source code / logs

Please paste or attach the code or logs or traces that would be helpful to diagnose the issue you are reporting.

```csharp
public class OnnxRunner
    {
        public class InputData
        {
            [VectorType(10)]
            public float[] data_0;
        }

        public class PredictionOutput
        {
            [ColumnName("label")]
            public uint Label { get; set; }
            [ColumnName("probabilities")]
            public float[] Probabilities { get; set; }
        }

        public void Run()
        {
            using (var env = new ConsoleEnvironment(null, false, 0, 1, null, null))
            {
                var dataPath = Path.Combine(Environment.CurrentDirectory, "sample_test_data.csv");
                var modelPath = Path.Combine(Environment.CurrentDirectory, "sample.onnx");
                var outputPath = Path.Combine(Environment.CurrentDirectory, "output.txt");

                var inputData = File.ReadLines(dataPath).Skip(1).Select(row => new InputData
                {
                    data_0 = row.Split(new char[] {  '\t' }).Select(token => float.Parse(token)).ToArray()
                }).ToList();

                var inputName = "data_0";
                var outputName = "label";

                var data = ComponentCreation.CreateDataView<InputData>(env, inputData);
                var pipeline = new OnnxEstimator(env, modelPath, inputName, outputName);
                var transformer = pipeline.Fit(data);
                var result = transformer.Transform(data);
            }
        }
    }
```

Sample ONNX file and data are here:
[sample.zip](https://github.com/dotnet/machinelearning/files/2497637/sample.zip)

I tracked the exception that it throws from here:
https://github.com/dotnet/machinelearning/blob/06b5ea6252e2c2766045d5f1436c55c1ccd8929d/src/Microsoft.ML.OnnxTransform/OnnxUtils.cs#L178

The ONNX file is generated by Python onnxmltools 1.2.2.129, the classifier in the model is lightgbm multi class classifier (v2.2.1)
